layui.use("form",function(){var a=layui.form});function login(){var b=$("#form-login-email").val();var a=$("#form-login-password").val();var c={email:b,password:a};if(!b||!a){return 0}$.ajax({url:url_login,type:"POST",data:c,xhrFields:{withCredentials:true},complete:function(d){if(200===d.status){window.location.href="./my_group.html"}else{if(400===d.status){alert("信息不全，请核对后重试")}else{if(404===d.status){alert("该邮箱未注册，请注册后重试")}else{if(403===d.status){alert("帐号或密码错误，请确认后重试")}else{alert("未知错误，请稍后重试")}}}}}})};